import React from "react";
import "../stylesheets/Header.scss";

const Header = () => {
  return (
    <div className="header--wrapper">
      <div className="header--atlas">
        <p className="header--atlas_n">N</p>
        <p className="header--atlas_w">W</p>
        <p className="header--atlas_s">S</p>
        <p className="header--atlas_o">O</p>
      </div>
    </div>
  );
};

export default Header;
